from typing import List


class Solution:
    def shortestBridge(self, grid: List[List[int]]) -> int:
        n = len(grid)
        loc = ()
        for r in range(n):
            for c in range(n):
                if grid[r][c] == 1:
                    loc = (r, c)
                    break
        q = [loc]
        tmp = [loc]
        visited = {loc}

        def in_range(x):
            return 0 <= x < n

        while tmp:
            a, b = tmp.pop()
            if in_range(a) and in_range(b + 1) and grid[a][b + 1] == 1 and (a, b + 1) not in visited:
                q.append((a, b + 1))
                tmp.append((a, b + 1))
                visited.add((a, b + 1))
            if in_range(a) and in_range(b - 1) and grid[a][b - 1] == 1 and (a, b - 1) not in visited:
                q.append((a, b - 1))
                tmp.append((a, b - 1))
                visited.add((a, b - 1))
            if in_range(a + 1) and in_range(b) and grid[a + 1][b] == 1 and (a + 1, b) not in visited:
                q.append((a + 1, b))
                tmp.append((a + 1, b))
                visited.add((a + 1, b))
            if in_range(a - 1) and in_range(b) and grid[a - 1][b] == 1 and (a - 1, b) not in visited:
                q.append((a - 1, b))
                tmp.append((a - 1, b))
                visited.add((a - 1, b))
        viewed = set(q)
        ans = 0
        while q:
            tp = []
            for a, b in q:
                if in_range(a) and in_range(b + 1) and (a, b + 1) not in viewed:
                    if grid[a][b + 1] == 1:
                        return ans
                    tp.append((a, b + 1))
                    viewed.add((a, b + 1))
                if in_range(a) and in_range(b - 1) and (a, b - 1) not in viewed:
                    if grid[a][b - 1] == 1:
                        return ans
                    tp.append((a, b - 1))
                    viewed.add((a, b - 1))
                if in_range(a + 1) and in_range(b) and (a + 1, b) not in viewed:
                    if grid[a + 1][b] == 1:
                        return ans
                    tp.append((a + 1, b))
                    viewed.add((a + 1, b))
                if in_range(a - 1) and in_range(b) and (a - 1, b) not in viewed:
                    if grid[a - 1][b] == 1:
                        return ans
                    tp.append((a - 1, b))
                    viewed.add((a - 1, b))
            q = tp
            ans += 1
        return ans


